import React from 'react';
import Header from './Header';
import './app.css';
import Post from './Post';

function App() {
  return (
    <div className='app'>
      <Header />
      <Post />
      <Post />
      <Post />
      <Post />
      <Post />
    </div>
  );
}

export default App;
